import React, {memo} from 'react';
import styled from 'styled-components';

const ListAddContainer = styled.div`
    background-color:#F9F9F9;
    width:100%;
    height: auto;

    .contentContainer{
        max-width: 1200px;
        height: auto;
        margin:0 auto;
        padding:120px 0 80px;

        .alignWrap{
            width:133px;
            height: 50px;
            background-color: #fff;
            margin-bottom: 20px;
        }

        .contentWrap{
            width:100%;
            height: auto;
            padding:33px 40px;
            border-top: 2px solid #333333;
            border: 1px solid #B3B3B3;
            background-color: #fff;

        }
    }

`;

const ListAdd = memo(() => {
    return (
        <ListAddContainer>
            <div className='contentContainer'>
                <div className='alignWrap'>
                    a
                    <button type='button' className='alignBtn left'></button>
                    <button type='button' className='alignBtn center'></button>
                    <button type='button' className='alignBtn right'></button>
                </div>
                <div className='contentWrap'>
                    <h1 className='title'></h1>
                    <p className='content'>
                        ㅈㄱㄴ
                    </p>
                </div>
            </div>
        </ListAddContainer>
    );
});

export default ListAdd;
